	switch (variant) {
		case "h1":
			<TextHeading1>{children}</TextHeading1>;
			break;
		case "h2":
			<TextHeading2>{children}</TextHeading2>;
		default:
			break;
	}

	return (
		<>
			{console.log(variant)}

